import { Key } from '@mui/icons-material';
import React from 'react'
import { useEffect } from 'react';
import { useState } from 'react';
import { getAllDishes } from '../../services/dish';


function ListDish() {
    const [dish, setDish] = useState([]);

    useEffect(() => {
        getAllDishes()
            .then((res) => {
                setDish(res)
            })
            .catch((error) => {
                console.log(error);
            })
    }, [dish])



    return (
        <div className='container'>
            <table id="customers">
                <tr>
                    <th>Name</th>
                    <th>Desc</th>
                    <th>Category</th>
                    <th>Sub Category</th>
                    <th>Price</th>
                    <th>Status</th>
                    <th>Actions</th>
                </tr>
                {dish.map((val) => {
                    return <>
                        <tr>
                            <td>{val.name}</td>
                            <td>{val.desc.slice(0,10)}...</td>
                            <td>{val.category}</td>
                            <td>{val.subcategory}</td>
                            <td>{val.price}</td>
                            <td>{val.status}</td>

                        </tr>
                    </>
                })}



            </table>
        </div>
    )
}

export default ListDish
